import React from "react";

const Chart = ({ data }) => {
  return (
    <div className="w-100 h-100">
      {data.map((x) => {
        return (
          <div
            style={{
              width: `${x * 20}%`,
              height: "20%",
              background: "blue",
              margin: "5px 0",
              borderRadius: "0 20px 20px 0",
            }}
          ></div>
        );
      })}
    </div>
  );
};

export default Chart;
